import React, { Component } from "react";
import AxiosFunction from "../../Functions/AxiosFunctions";
import RowTable from "./RowFavoritesTable";

export default class FavoritesTable extends Component {
  state = { players: "" };

  async test(){
      await AxiosFunction.get_favorite().then((list)=>{this.setState({ players: list.data.express })})
  }

  render() {
    this.test();
    return (
      <div>
        <h2>{this.props.name}</h2>
        <div><RowTable favorites='{this.state.players}'/> </div>
      </div>
    );
  }
}
